import react from 'react'
import search_icon from "./../images/svg/search.svg"
import "./../scss/Header.scss"
const Header = ()=>{
  return (
    <>
    <div className="Header_main">

      <img src={search_icon}/>

    </div>
    </>
  )
}
export default Header
